import React, { Component } from 'react';
import { Row } from 'react-bootstrap';

const tones = [
   {
      id: '1',
      hertz: '500', //500hz
      decibles: {
         path20: "./audio_tones/Hz500dB20.png",
         path25: "./audio_tones/Hz500dB25.png",
         path30: "./audio_tones/Hz500dB30.png",
         path35: "./audio_tones/Hz500dB35.png",
         path40: "./audio_tones/Hz500dB40.png",
         path45: "./audio_tones/Hz500dB45.png",
         path50: "./audio_tones/Hz500dB50.png"
      }
   },
   {
      id: '2',
      hertz: '1000', //1000hz
      decibles: {
         path20: "./audio_tones/Hz1000dB20.png",
         path25: "./audio_tones/Hz1000dB25.png",
         path30: "./audio_tones/Hz1000dB30.png",
         path35: "./audio_tones/Hz1000dB35.png",
         path40: "./audio_tones/Hz1000dB40.png",
         path45: "./audio_tones/Hz1000dB45.png",
         path50: "./audio_tones/Hz1000dB50.png"
      }
   },
];

const path = "audio_tones/Hz1000dB20.png";

class Audio extends Component {
   state = {
      tones: [],
      activeHertz: '',
      activeDecible: ''
   }

   componentDidMount() {
      this.setState({ tones: tones });
   }

   render() {
      return (
         <main>
            <div className="container text-center">
               <ToneDisplay />
               <h4 className="font-weight-light py-2 m-0">Do you hear this tone?</h4>
               <AudioResponse />
             </div>
         </main>
      );
   }
}

class ToneDisplay extends Component {
   render() {
      return (
         <div>
            <img src={path} alt="Logo" />
         </div>
      );
   }
}

class AudioResponse extends Component {
   render() {
      return (
         <div className="mb-4 m-2 containter">
            <div className="row py-2">
               <div className="col-md">
                  <button type="button" className="btn btn-dark float-right w-25">
                     <i class="bi bi-hand-thumbs-down text-black"></i> No 
                  </button>
               </div>
               <div className="col-md">
                  <button type="button" className="btn btn-info text-black float-left w-25">
                     <i class="bi bi-hand-thumbs-up text-black"></i> Yes 
                  </button>
               </div>
            </div>
            <div className="row py-2">
               <div className="col-md">
                  {/* disply play when audio is not playing and other when not */}
                  <button type="link" className="btn text-dark bg-light disabled" 
                     disabled={false}
                     onClick={() => console.log("play clicked")}>
                     Replay Tone?
                  </button>
               </div>
            </div>
         </div>
      );
   }
}

